import React from 'react'
import {Route, Routes } from 'react-router-dom';
import E404 from './Components/404';
import Account from './Components/Account';
import CategoryPage from './Components/CategoryPage';
import Checkout from './Components/Checkout';
import Success from './Components/Checkout/success';
import Home from './Components/Home';
import OrderHistory from './Components/OrderHistory';
import ProductPage from './Components/ProductPage';
import { useSellerData } from './Contexts/SellerContext';

function Main(props) {
    const SellerData = useSellerData()
    return (
        <>
        <Navbar Arr={Categories} />
        <CatMenu Arr={Categories} />
        <div className="m-24">
       {(Object.keys(SellerData).length>0) ? 
        <Routes>
        <Route exact path="/" element={<Home Arr={props.Arr}/>} ></Route>
        <Route  path="Category/:id" element={<CategoryPage/>} ></Route>
        <Route  path="Product/:id" element={<ProductPage/>} ></Route>
        <Route  path="Account/" element={<Account/>} ></Route>
        <Route  path="Checkout" element={<Checkout/>} ></Route>
        <Route  path="OrderHistory/:id" element={<Success/>} ></Route>
        <Route  path="OrderHistory" element={<OrderHistory/>} ></Route>
        </Routes> : 
        <Routes>
            <Route exact path="/" element={<E404/>} ></Route>
        </Routes>}
        </div>
            <Footer Arr={Categories} title="Foot" />
            </>
    ) 
}

export default Main
